import React from "react";
import ChartBar from "./CharBar";
import styles from "./Chart.module.css";

const Chart = (props) => {
  return (
    <div className={styles.chart}>
      {props.dataPoints.map((dataPoint) => (
        <ChartBar key={dataPoint.label} />
      ))}
    </div>
  );
};

export default Chart;
